import Camera from '../images/Camera.png'

function Gear() {
  return (
    <div className='intro-container'>
      <div className='img-container'>
        <img src={Camera} alt='Field of stars' />
      </div>
      <div className='title'>
        <h1>GEAR</h1>
      </div>
    </div>
  );
};

export default Gear;
